import {React, useState} from "react"


const Radio = () => {
    const json = [
        {
            id: 1,
            text: "java"
        },
        {
            id: 2,
            text: "java"
        },
        {
            id: 3,
            text: "java"
        }
    ]
    // const [data,setData] = useState(json);
    // const []

    return (
        <>
            {json&&
                json.map(node => {
                    <div v>
                        <input type="radio" />
                        <li  > {node.id}</li>
                    </div>
                })
            }
        </>
    )
}

export default Radio
